import React from 'react'
import LigneBareDefilement from '../componentReutilisable/LigneBareDefilement'
import imgStar from "../assets/images/star-brn.svg"
import imgLogo from "../assets/images/logo-no-text.svg"
import imgSupply from "../assets/images/supply-footer-logo.svg"
import imgClover from "../assets/images/clover.svg"
import { useEffect } from 'react'
import { useRef } from 'react'


export default function PartieIntroduction() {
    const informationGradient =useRef("");
    const fontAleatoire =useRef("");
    const fontSpecialUn =useRef("");
    const fontSpecialDeux =useRef("");
    const fontBasiqueUn =useRef("");
    const fontBasiqueDeux =useRef("");
    const containerLogo =useRef("");
    const imgCloverRef =useRef("");
    const imgStarRef =useRef("");
    const textDisparitionUn =useRef("");
    const textDisparitionDeux =useRef("");
    const textDisparitionTrois =useRef("");
    const allTextDisparition =[textDisparitionDeux,textDisparitionTrois];
    const tabText=["talent curation","team building","peaple connecting"];
    let k =0;
    let y =2;
    const interval=() => setInterval(() => {
        if(y===3){
            y=0;
        }
        allTextDisparition[k].current.classList.remove('animMonterText');
        allTextDisparition[k].current.classList.remove('animDescendreText');
        allTextDisparition[k].current.classList.add('animDescendreText');
        setTimeout(() => {
            allTextDisparition[k].current.innerText=tabText[y];
            y++;
        }, 100);
        if(k===1){
            allTextDisparition[0].current.classList.remove('animMonterText');
            allTextDisparition[0].current.classList.remove('animDescendreText');
            allTextDisparition[0].classList.add('animMonterText');
            k=0;
            return;
        }
        if(k<1){
            allTextDisparition[k+1].current.classList.remove('animMonterText');
            allTextDisparition[k+1].current.classList.remove('animDescendreText');
            allTextDisparition[k+1].current.classList.add('animMonterText');
            k++;
            return;
        }
    
    }, 3000);

    useEffect(() => {

      informationGradient.current.style.transform="translateY(0px)"

        setTimeout(() => {
            informationGradient.current.style.transform='rotate(5deg)';
            fontAleatoire.current.style.transform='translateY(0px) ';
        }, 200);
        setTimeout(() => {
            fontAleatoire.current.style.transform=' rotate(0deg)';
            fontSpecialUn.current.style.transform='translateY(0px)'
            fontSpecialDeux.current.style.transform='translateY(0px)'
        }, 400);
        setTimeout(() => {
            fontSpecialUn.current.style.transform='rotate(0deg)'
            fontSpecialDeux.current.style.transform='rotate(0deg)'
            fontBasiqueUn.current.style.transform='translateY(0px)'
            fontBasiqueDeux.current.style.transform='translateY(0px)'
        }, 600);
        setTimeout(() => {
            containerLogo.current.style.opacity="1";
        }, 1500);
        setTimeout(() => {
            imgCloverRef.current.style.left ="60%";
            imgCloverRef.current.style.opacity ="1";
        }, 1700);
        setTimeout(() => {
            imgStarRef.current.style.opacity="1";
        }, 1900);

        setTimeout(() => {
            textDisparitionUn.current.classList.add('animDescendreText');
            textDisparitionDeux.current.classList.add('animMonterText');
            interval();
        }, 3000);
    
      return () => {
        clearInterval(interval);
      }
    }, [])
    
  return (
    <div className="bg-blancGris w-screen h-screen min-h-[1200px] flex flex-col">
       <nav className='h-[46px] bg-orangeCLair w-[10000px] z-10 '>
            <ul className='flex h-full no-underline'>
               <LigneBareDefilement></LigneBareDefilement>
               <LigneBareDefilement></LigneBareDefilement>
               <LigneBareDefilement></LigneBareDefilement>
            </ul>
        </nav>
        <img ref={imgStarRef} className='supp691:left[90%] supp1700:top[130px] supp1700:left[215px] absolute top-[170px] left-[80%] z-[8] opacity-0 transition-all duration-300 ease-linear' src={imgStar} alt=" forme d'étoile marron." />
        <div  className='supp1700:right[150px] absolute top-20 left-[5%] flex items-center justify-center h-[200px] w-[200px] z-[8]'>
            <div ref={containerLogo} className='w-full h-full relative opacity-0 transition-all duration-300 ease-linear'>
                <img className='absolute top-0 left-0'  src={imgLogo} alt="Logo orange rond ondulé." />
                <img className='absolute top[40%] left[20%] rotate-[15deg] '  src={imgSupply} alt="un texte avec inscrit The Supply."/>
            </div>
        </div>
        <div style={{backgroundImage:"radial-gradient(#E8E8E8 10%,#F8F7F2 10%)",backgroundSize:"65px 65px"}} className='relative h-[50%] w-[90%] my-0 mx-auto mt-[10%]'>
            <img ref={imgCloverRef} className='absolute top[50%] left-[80%] scale-[0.8] rotate-[24deg] transition-all duration-200 ease-linear opacity-0' src={imgClover} alt=" forme de croix rouge." />
            <div ref={informationGradient} style={{transition:"transform 0.8s cubic-bezier(0.17, 0.54, 0.27, 0.79)"}} className='supp1700:w-[650px] supp1700:left-[30%] supp1700:top-[65%] supp1205:top-[100%] supp900:left-[20%] supp800:left-[10%] w-[80vw] h-auto bg-belge absolute top-[65%] left[2%] rotate[15deg] translate-y-[-900px] p-5 text-xl rounded-lg tracking-[1px] leading-[30px] '>
                We're a close group of industry vets who hail from the designe and production
                worl. We value the power of a strong curated talent network; folks we 🍻and 🍕with, 
                not just keywords in a search field.<br></br>
                 A combined 25 years under our belt helps talent and our
                client trust that we just "get it".
            </div>
           <div className="w-full absolute top-[10%] left-0 text-center leading-[90px]">
                <p ref={fontBasiqueUn} style={{transition:"all 0.8s cubic-bezier(0.17, 0.54, 0.27, 0.79)"}} className="text-[105px] font-[Cormorant] tracking[5px] p-0 text-bleuGris leading-90px transform translate-y-[-500px]  ">A fresh approach to</p>
                <div ref={fontSpecialUn} style={{transition:"all 0.8s cubic-bezier(0.17, 0.54, 0.27, 0.79)"}} className="text-[90px] font-[Candal] font-bold tracking[5px] pl-[5px]  text-bleuGris leading-90px transform translate-y-[-500px] rotate-[10deg] relative overflow-hidden">
                    <p ref={textDisparitionUn}>  talent curation</p>
                    <p ref={textDisparitionDeux} className="absolute top-0 left-0 w-full text-center transform translate-y-[100%]" >team building</p>
                    <p ref={textDisparitionTrois} className="absolute top-0 left-0 w-full text-center transform translate-y-[100%]" >peaple connecting</p>
                </div>
                <p ref={fontAleatoire} style={{transition:"all 0.8s cubic-bezier(0.17, 0.54, 0.27, 0.79)"}} className="transform translate-y-[-500px] rotate-[-10deg] "><span ref={fontBasiqueDeux} style={{transition:"all 0.8s cubic-bezier(0.17, 0.54, 0.27, 0.79)"}} className="text-[105px] font-[Cormorant] tracking[5px] p-0 text-bleuGris leading-90px transform translate-y-[-500px]  ">with a</span> <span ref={fontSpecialDeux} style={{transition:"all 0.8s cubic-bezier(0.17, 0.54, 0.27, 0.79)"}} className="text-[90px] font-[Candal] font-bold tracking[5px] pl-[5px]  text-bleuGris leading-90px transform translate-y-[-500px] rotate-[10deg] ">maker mindset</span></p>
           </div>
        </div>
    </div>
  )
}
